customStyles:
.review__text { font-size: 11pt}
.widget__leave-link {
background: #5c4cff;
}

.widget__leave{
color: rgb(255 17 17);
}

@media (min-width: 1200px) {
    .ngucarousel .ngu-touch-container .ngucarousel-items .item {
        flex: 0 0 33.333%!important;
        width: 33.333%!important;
    }
}

@media (min-width: 1200px) and (max-width: 1400px) {
    .ngucarousel-items .item {
        flex: 0 0 33.4% !important;
        width: 33.4% !important;
    }
}

.review__text {
    line-height: 140%;
    color: #333333;
}
.review__date {
    line-height: 160%;
}

.review__text {
    font-size: 11pt;
}

.widget__leave-link {text-decoration: none}

.widget__header {display: none;}
.widget__src {display: none;}


.review, .widget__header, .widget__tab, review-lab .widget__pag {
background-color: #FDF8F0;
}
.review__text {font-size: 7pt;}
.title {font-family: 'Manrope-Regular';}

.widget {color: red};
.widget__header {background-color: red};
.review {background-color: red};

.widget:hover .review {
    box-shadow: 0 5px 7px rgb(0 0 0 / 35%);
}
.review {
    border-radius: 0;
    box-shadow: none;
    border: 1px solid #eee;
}

.review__body {
    margin-top: 20px;
    overflow: hidden;
    flex-grow: 1;
    color: #565555;
    line-height: 1.4;
}
.widget__tab_active {
    cursor: default;
    color: black;
}

.widget__header {
    width: -webkit-fit-content;
    width: -moz-fit-content;
    width: fit-content;
    margin: 0 calc(48px + 8px * 3);
    display: flex;
    flex-wrap: wrap;
    border-radius: 16px;
    background-color: rgb(238 202 82);
    box-shadow: 0 0 2px 4px rgb(43 43 43 / 5%);
}
.widget__count {
    color: #eeca52;
}
.review__title {
    margin-top: 5px;
    color: black;
}

/*@media(max-width: 600px) {*/
/*    .ngucarousel > .ngu-touch-container > .ngucarousel-items > .item {*/
/*    flex: 0 0 100% !important;*/
/*    width: 100% !important;}*/
/*}*/

@media(min-width: 801px) {
    .ngucarousel > .ngu-touch-container > .ngucarousel-items > .item {
    flex: 0 0 100% !important;
    width: 100% !important;}
}

@media(min-width: 992px) {
    .ngucarousel > .ngu-touch-container > .ngucarousel-items > .item {
    flex: 0 0 50% !important;
    width: 50% !important;}
}
@media(min-width: 1300px) {
    .ngucarousel > .ngu-touch-container > .ngucarousel-items > .item {
    flex: 0 0 33.3% !important;
    width: 33.3% !important;}
}

@media(min-width: 1700px) {
    .ngucarousel > .ngu-touch-container > .ngucarousel-items > .item {
    flex: 0 0 25% !important;
    width: 25% !important;}
}

.widget__leave-link {
    font-size: 20px;
    font-weight: 900;
    color: #2e5077;
}

.widget__count {
    font-weight: 900;
}

.review {
    background-color: #EFEEEE;
    box-shadow: -3px -3px 10px #fff, 3px 3px 10px rgb(209 205 199 / 50%);
    transition: .3s ease;
    margin-left: 3px;
    margin-right: 3px;
}

.review:hover {
    transition: .3s ease;
    transform: scale(1.02);
    box-shadow: -3px -3px 10px #fff, 3px 3px 10px rgb(209 205 199 / 50%);
}

.widget__pag {
    box-shadow: -3px -3px 10px rgb(209 205 199 / 50%), 6px 6px 16px rgb(209 205 199 / 50%);
}

.review {
	padding: 28px;
	width: 100%;
	border: 1px solid #e9e9e9;
	border-radius: 10px;
	background-color: #ffffff;
	box-shadow:none;
	box-sizing: border-box;
}
.review:hover {
    box-shadow:none;
}
.widget__header {
    display: none;
}
.ngucarousel {
    padding: 0;
	overflow: visible !important;
}
.ngucarousel-items {
    margin-top: 0 !important;
}
.widget__pag {
	width: 26px;
	height: 26px;
	padding: 0;
	border: 2px solid #f5821f;
	box-shadow: none;
	top: -50px;
	z-index: 10;
}
.widget__pag:hover {
	box-shadow: none;
}
.widget__pag_prev {
	left: auto;
	right: 55px;
}
.widget__pag_next {
	right: 8px;
}
.widget__pag .icon {
	display: none;
}
.widget__pag::before {
	content: "";
	position: absolute;
	top: 55%;
	left: 50%;
	width: 10px;
	height: 10px;
	border: 2px solid #f5821f;
	border-top-style: none;
	border-right-style: none;
	transform: translate(-34%, -55%) rotate(45deg);
}
.widget__pag_next::before {
	transform: translate(-64%, -55%) rotate(-135deg);
}
.widget__src--mobile {
    display:none;
}

.review {background:#F0F6F9;}
.widget__tab {background:#F0F6F9;}
.widget__pag {background:#F0F6F9;}
.widget__pag {display:none;}
.ngucarousel {padding: 0;}
.widget__header {margin:0;}

.widget { color: #121212 }
.widget__leave { background: none; border-radius: 15px;  height: 35px;}
.widget__leave:hover {background: #fff;  height: 35px;}
.widget__header { color: #e9e9e9 }
.widget__pag_prev { background: #121212 }
.widget__pag_prev:hover { background: #ff4545 }
.widget__pag_next { background: #121212 }
.widget__pag_next:hover {background: #ff4545 }
.widget__pag .icon:hover { fill: #121212}
.review__header { color: #e9e9e9 }
.review { background: #151515; font color: #e9e9e9 }
.review__text { color:#e9e9e9 }
.review__title { color:#e9e9e9 }
.review__more { color:#d4d4d4 }
.widget__tab { background: none; }
.widget__tab:hover { background: none; }
.widget__leave-link { background: #ff4545; border-radius: 15px; font-weight: normal ;}
.widget__leave-link:hover { background: #fa3c3c; border-radius: 15px;}
.widget__tab_active { background: none; border: 1px solid #ff4545; opacity: 1 }
.widget__tab--rating { color: #fff; }
.review_footer {color: #fff }
.widget__pag .icon { fill: #ff4545}
.widget__point {background-color: #ff4545}

@media (min-width: 1200px) {
    .ngucarousel .ngu-touch-container .ngucarousel-items .item {
        flex: 0 0 33.333%!important;
        width: 33.333%!important;
    }
}
.widget__point {
    min-width: 8px;
}
@media (max-width: 480px) {
    .ngucarousel {
        max-width: 280px;
    }
    .widget__points {
        display: none;
    }

.widget__point.widget__point_active:before {
    content: "" !important;
}

@media (max-width: 767px) {
    .ngucarousel > .ngu-touch-container > .ngucarousel-items .item {
        flex: 0 0 100%;
        width: 100%;
    }
}

.review__photo {
    max-height: 150px;
}

.widget__pag.widget__pag_prev,
.widget__pag.widget__pag_next,
.widget__src.widget__src--desktop.widget__src--desktop-carousel,
.widget__footer.carousel,
.widget__src.widget__src--mobile.widget__src--mobile-carousel {
    display: none;
}
.ngucarousel {
    padding: 0!important;
}

review-lab {
    max-width: 92vw;
}

.widget__layout {
    margin: 0 !important;
    gap: 25px !important;
}

.widget__header {
    margin-bottom: 31px !important;
}

.widget__review {
    max-width: 785px !important;
    border-bottom: 1px solid rgba(187, 187, 187, 0.5);
    padding-bottom: 25px;
}
.review {
    box-shadow: none;
    padding: 0;
}
.review:hover {
    box-shadow: none;
}
.widget__tabs {
    background: #F4F4F4;
    border-radius: 5px;
    height: 50px;
    width: 580px;
    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
    gap: 50px;
}

.review__header-left {
    display: none;
}
widget-review .review__rating .icon_active {
    fill: #F5AF33;
}
.widget__tab_active,
.widget__tab_active:hover{
    background: none !important;   
}

.review__title > span {
    font-family: 'Futura PT';
    font-style: normal;
    font-weight: 600;
    font-size: 20px !important;
    line-height: 26px;
    color: #272727;
}

.review__title {
    margin-top: 5px !important;
}

.review__date {
    font-family: 'Futura PT';
    font-style: normal;
    font-weight: 400;
    font-size: 16px;
    line-height: 21px;
    color: #777777;
}

.review__text {
    font-family: "FuturaPT";
    font-style: normal;
    font-weight: 300;
    font-size: 18px;
    line-height: 21px;
    color: #272727;
}

.review__footer {
    font-family: 'Futura PT';
    font-style: normal;
    font-weight: 400;
    font-size: 16px;
    line-height: 26px;
    text-decoration-line: underline;
    color: #777777;
    margin-top: 15px;
}

.widget__show-more {
    margin-top: 25px !important;
}

.widget__show-more:after {
    border-bottom: 1px solid rgba(43,43,43,.65)!important;
