.widget__tabs {
    background: #F4F4F4;
    border-radius: 5px;
    height: 50px;
    width: 580px;
    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
    gap: 50px;
}

.review__header-left {
    display: none;
}
widget-review .review__rating .icon_active {
    fill: #F5AF33;
}
.widget__tab_active,
.widget__tab_active:hover{
    background: none !important;   
}

.review__title > span {
    font-family: 'Futura PT';
    font-style: normal;
    font-weight: 600;
    font-size: 20px !important;
