    font-weight: 400;
    font-size: 16px;
    line-height: 21px;
    color: #777777;
}

.review__text {
    font-family: "FuturaPT";
    font-style: normal;
    font-weight: 300;
    font-size: 18px;
    line-height: 21px;
    color: #272727;
}

.review__footer {
    font-family: 'Futura PT';
    font-style: normal;
    font-weight: 400;
    font-size: 16px;
    line-height: 26px;
    text-decoration-line: underline;
    color: #777777;
    margin-top: 15px;
}

.widget__show-more {
    margin-top: 25px !important;
}

.widget__show-more:after {
    border-bottom: 1px solid rgba(43,43,43,.65)!important;
