[data-area="control-left"],
[data-area="control-right"] {
    position: absolute;
    top: 50%;
    transform: translateY(-50%);
    z-index: 2;
}

[data-area="control-left"] {
    left: -25px;
}

[data-area="control-right"] {
    right: -25px;
}

.widget__pag {
    background-color: white !important;
    box-shadow: 0px 0px 8px 0px #00000026;
    border-radius: 50%;
    margin: 0;
    padding: 10px !important;
    transition: all 0.3s ease;
    width: 45px;
    height: 45px;
    pointer-events: auto;
    cursor: pointer;
    border: none;
    display: flex;
    align-items: center;
    justify-content: center;
}

.widget__pag svg {
    width: 24px;
    height: 24px;
}

.widget__pag svg path:last-child {
    transition: fill 0.3s ease;
    fill: #333;
}

.widget__pag svg path:first-child {
    fill: none;
}

.widget__pag:hover {
    background: rgba(255, 255, 255, 0.8) !important;
}

.widget__pag:hover svg path:last-child {
    fill: #DBCF05;
}

.widget__pag:active {
    transform: scale(0.95);
}

.widget__pag:disabled {
    opacity: 0.5;
    cursor: not-allowed;
}

[data-area="control-left"] .widget__pag,
[data-area="control-right"] .widget__pag {
    position: relative;
    top: 50%;
    transform: translateY(-50%);
}

[data-area="bottom-right"] {
    display: none;
}

